import React, {useEffect, useState} from 'react';
import axios from "axios";

const ModelDetails = ({ model, onClose }) => {
  const [tableName, setTableName] = useState(null);

  useEffect(() => {
    // Fetch tasks from Flask backend using Axios
    axios.get('http://127.0.0.1:5000/viewTable')
      .then(response => {
        setTableName(response.data.name);
        console.log(response.data);
      })
      .catch(error => {
        console.error('Error fetching pulling:', error);
      });
  }, [model.table_configuration_id]);

  if (!model) return null;

  return (
    <div className="modal">
        <div className="modal-content">
            <h2>Details</h2>
            <p>{model.name}</p>
            <p>{model.description}</p>
            <p>{model.model_file}</p>
            <p>{model.created_date}</p>
            <p>{tableName ? tableName : 'Loading table name...'}</p>
            <button onClick={onClose}>Close</button>
        </div>
    </div>
  );
};

export default ModelDetails;
